"use strict";

function find_prefix(match, current_level = prefix_tree) {
    const next_level = current_level[match[0]];
    if (!next_level || typeof next_level === 'string') {
        return next_level;
    }
    return find_prefix(match.slice(1), next_level);
}

function recurse_unpack(idx) {
    let this_level = {};
    while (true) {
        let key = compressed_tree[idx];
        if (key === '}') {
            ++idx;
            return {idx, value: this_level};
        }
        let value;
        if (compressed_tree[idx+1] === '{') {
            ({idx, value} = recurse_unpack(idx+2));
        }
        else {
            value = [...atob(compressed_tree.slice(idx+1, idx+4) + '=')].map(c=>c.charCodeAt(0).toString(16).padStart(2, '0')).join('');
            idx += 4;
        }
        this_level[key] = value;
    }
}

